svg.script:
let saito = false;

let animID;
let timeoutID;

let nonsaito_init = 250;
let total_frames = 680;
let total_loop = 620;
let saito_loop = 300;
let counter = 0;
let popup = 1;
let pause = true;

function $(sel) {
  return document.querySelector(sel);
}

function switch_mode() {
  if(saito) {
    for(let i=1; i<26; i++) {
      $("#dots" + i).setAttribute("class", "n b");
    }
    $("#saito_users").classList.remove("n");
    $("#saito_lines").classList.remove("n");
    $("#saito_nodes").classList.remove("n");
    $("#saito_popups").classList.remove("n");
    $("#non_saito_nds").classList.add("n");
    $("#saito_nds").classList.remove("n");

  } else {
    for(let i=1; i<26; i++) {
      $("#dots" + i).setAttribute("class", "n");
    }
    $("#nonsaito_icons").classList.remove("n");
    $("#infrastructure").classList.remove("n");
    $("#user_lines").classList.remove("n");
    $("#circles").classList.remove("n");
    $("#app_lines").classList.remove("n");
    $("#nonsaito_nodes").classList.remove("n", "h");
    $("#nonsaito_popups").classList.remove("n");
    $("#non_saito_nds").classList.remove("n");
    $("#saito_nds").classList.add("n");
  }
}

function initial_state() {

  clearTimeout(timeoutID);
  counter = 0;
  popup = 1;

  $("#replay_bttn").classList.add("n", "h");

  for(let i=1; i<12; i++) {
    $("#money" + i).setAttribute("class", "op h n");
  }
  for(let i=1; i<8; i++) {
    $("#node_glow" + i).setAttribute("class", "op h");
  }
  for(let i=1; i<5; i++) {
    $("#popup" + i).setAttribute("class", "");
  }
  for(let i=1; i<7; i++) {
    $("#spopup" + i).setAttribute("class", "");
  }

  $("#miner_glow1").setAttribute("class", "op h");
  $("#miner_glow2").setAttribute("class", "op h");
  $("#snode_glow1").setAttribute("class", "op h");
  $("#snode_glow2").setAttribute("class", "op h");
  $("#beam1").classList.add("n");
  $("#beam2").classList.add("n");
  $("#sbeam1").classList.add("n");
  $("#sbeam2").classList.add("n");
  $("#ubeam1").classList.add("n");
  $("#ubeam2").classList.add("n");
  $("#ubeam3").classList.add("n");  

  $("#nonsaito_icons").setAttribute("class", "n");
  $("#infrastructure").setAttribute("class", "op h n");
  $("#saito_users").setAttribute("class", "op h n");
  $("#user_lines").setAttribute("class", "op h n");
  $("#user_icons").setAttribute("class", "op h");
  $("#circles").setAttribute("class", "op h n");
  $("#init_lines").setAttribute("class", "op h");
  $("#app_lines").setAttribute("class", "op h n");
  $("#saito_lines").setAttribute("class", "op h n");
  $("#to_miners").setAttribute("class", "");
  $("#saito_app_lines").setAttribute("class", "op h");
  $("#node_icns").setAttribute("class", "op h");
  $("#miner_icns").setAttribute("class", "op h");
  $("#nonsaito_nodes").setAttribute("class", "op h n");
  $("#saito_nodes").setAttribute("class", "op h n");
  $("#nonsaito_popups").setAttribute("class", "n");
  $("#saito_popups").setAttribute("class", "n");
}

function add_cl(name, arr, class_arr) {
  for(let i = 0; i < arr.length; i++) {
    $("#" + name + arr[i]).classList.add(class_arr);
  }
}

function remove_cl(name, arr, class_arr) {
  for(let i = 0; i < arr.length; i++) {
    $("#" + name + arr[i]).classList.remove(class_arr);
  }
}

$("#switch-body").addEventListener("click", function() {
  cancelAnimationFrame(animID);
  $("#switch").classList.toggle("saito");
  saito ? saito = false : saito = true;
  initial_state();
  switch_mode();
  animID = requestAnimationFrame(animate);
}, false);

$("#replay_bttn").addEventListener("click", function() {
  cancelAnimationFrame(animID);
  initial_state();
  switch_mode();
  animID = requestAnimationFrame(animate);
}, false);

function animate() {
  if(saito) {

    if(counter == 10) {
      $("#switch").classList.remove("h");
      $("#saito_users").classList.remove("h");
      $("#replay_bttn").classList.remove("n");
    }

    if(counter == 20) {
      $("#replay_bttn").classList.remove("h");
    }

    if(counter == 60) {
      $("#nonsaito_nodes").classList.remove("h", "n");
      $("#to_miners").classList.add("op", "h");
      $("#node_icns").classList.remove("h");
      $("#init_lines").classList.remove("h");
    }

    if(counter == 100) {
      $("#saito_lines").classList.remove("h");
      add_cl("dots", [20, 21, 22], ["n"]);
      if(popup == 1) {
        $("#spopup1").setAttribute("class", "vis");
        popup++;
      }
    }

    if(counter == 140) {
      remove_cl("dots", [20, 21, 22], ["n"]);
    }

    if(counter == 190) {
      remove_cl("node_glow", [2, 5], ["h"]);
    }

    if(counter == 230) {
      remove_cl("money", [3, 4], ["n"]);
      add_cl("node_glow", [2, 5], ["h"]);
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }

    if(counter == 240) {
      remove_cl("money", [3, 4], ["h"]);
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }

    if(counter == 280) {
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("money", [5, 6, 7, 8], ["n"]);
      add_cl("dots", [12, 13], ["n"]);
    }

    if(counter == 300) {
      remove_cl("money", [5, 6, 7, 8], ["h"]);
      remove_cl("dots", [12, 13], ["n"]);
    }

    if(counter == 320) {
      add_cl("node_glow", [1, 3, 6, 7], ["h"]);
    }

    if(counter == 330) {
      remove_cl("money", [9], ["n"]);
      remove_cl("node_glow", [4], ["h"]);
      add_cl("money", [3, 4], ["h"]);
    }

    if(counter == 340) {
      remove_cl("money", [9], ["h"]);
      add_cl("money", [3, 4], ["n"]);
    }

    if(counter == 370) {
      add_cl("money", [5, 6, 7, 8], ["h"]);
      add_cl("node_glow", [4], ["h"]);
      if(popup == 2) {
        $("#spopup2").setAttribute("class", "vis");
        popup++;
      }
    }

    if(counter == 390) {
      add_cl("money", [5, 6, 7, 8], ["n"]);
    }

    if(counter == 420) {
      add_cl("money", [9], ["h"]);
      add_cl("dots", [20, 21, 22], ["n"]);
      $("#to_miners").classList.remove("h");
      $("#miner_icns").classList.remove("h");
    }

    if(counter == 430) {
      remove_cl("dots", [20, 21, 22], ["n"]);
      remove_cl("sbeam", [1, 2], ["n"]);
    }

    if(counter == 450) {
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
      add_cl("money", [9], ["n"]);
      $("#saito_nodes").classList.remove("h");
      $("#saito_app_lines").classList.remove("h");
      $("#nonsaito_nodes").classList.add("n");
    }

    if(counter == 480) {
      remove_cl("money", [10, 11], ["n"]);
      remove_cl("snode_glow", [1, 2], ["h"]);
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }

    if(counter == 500) {
      remove_cl("money", [10, 11], ["h"]);
    }

    if(counter == 520) {
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("money", [5, 6, 7, 8], ["n"]);
      add_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
      add_cl("snode_glow", [1, 2], ["h"]);
    }

    if(counter == 540) {
      remove_cl("money", [5, 6, 7, 8], ["h"]);
      remove_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
    }

    if(counter == 560) {
      add_cl("node_glow", [1, 3, 6, 7], ["h"]);
    }

    if(counter == 570) {
      remove_cl("money", [1, 2, 9], ["n"]);
      remove_cl("node_glow", [4], ["h"]);
      remove_cl("miner_glow", [1, 2], ["h"]);
      add_cl("money", [3, 4], ["h"]);
    }

    if(counter == 580) {
      remove_cl("money", [1, 2, 9], ["h"]);
      add_cl("money", [10, 11], ["h"]);
      add_cl("money", [3, 4], ["n"]);
    }

    if(counter == 610) {
      add_cl("money", [5, 6, 7, 8], ["h"]);
      add_cl("node_glow", [4], ["h"]);
      add_cl("miner_glow", [1, 2], ["h"]);
    }

    if(counter == 620) {
      add_cl("money", [10, 11], ["n"]);
    }

    if(counter == 630) {
      add_cl("money", [5, 6, 7, 8], ["n"]);
    }

    if(counter == 650) {
      add_cl("money", [1, 2, 9], ["h"]);
    }

    if(counter == 670) {
      add_cl("money", [1, 2, 9], ["n"]);
      if(popup == 3) {
        $("#spopup3").setAttribute("class", "vis");
        popup++;
      }
    }

    counter++;
    if(counter < total_frames) {
      animID = requestAnimationFrame(animate);
    } else {
      counter = 0;
      animID = requestAnimationFrame(animate2);
    }

  } else {

    if(counter == 10) {
      $("#circles").classList.remove("h");
      $("#init_lines").classList.remove("h");
    }
    if(counter == 40) {
      $("#miner_icns").classList.remove("h");
    }
    if(counter == 70) {
      $("#node_icns").classList.remove("h");
    }
    if(counter == 100) {
      $("#user_icons").classList.remove("h");
    }
    if(counter == 110) {
      $("#replay_bttn").classList.remove("n");
      $("#switch").classList.remove("n");
    }
    if(counter == 130) {
      $("#switch").classList.remove("h");
      $("#replay_bttn").classList.remove("h");
      $("#infrastructure").classList.remove("h");
    }
    if(counter == 160) {
      $("#app_lines").classList.remove("h");
    }
    if(counter == 190) {
      $("#user_lines").classList.remove("h");
    }

    counter++;
    if(counter < nonsaito_init) {
      animID = requestAnimationFrame(animate);
    } else {
      $("#switch").classList.remove("h");
      counter = 0;
      animID = requestAnimationFrame(animate2);
    }
  }
}

function animate2() {
  if(saito) {
    if(counter == 0) {
      add_cl("dots", [20, 21, 22], ["n"]);
      add_cl("sbeam", [1, 2], ["n"]);
    }
    if(counter == 10) {
      remove_cl("dots", [20, 21, 22], ["n"]);
      remove_cl("sbeam", [1, 2], ["n"]);
    }

    if(counter == 30) {
      add_cl("money", [9], ["n"]);
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }

    if(counter == 60) {
      remove_cl("money", [10, 11], ["n"]);
      remove_cl("snode_glow", [1, 2], ["h"]);
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }

    if(counter == 80) {
      remove_cl("money", [10, 11], ["h"]);
    }

    if(counter == 100) {
      add_cl("snode_glow", [1, 2], ["h"]);
      add_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("money", [5, 6, 7, 8], ["n"]);
    }

    if(counter == 120) {
      remove_cl("money", [5, 6, 7, 8], ["h"]);
      remove_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
    }

    if(counter == 140) {
      add_cl("node_glow", [1, 3, 6, 7], ["h"]);
    }

    if(counter == 150) {
      add_cl("money", [3, 4], ["h"]);
      remove_cl("node_glow", [4], ["h"]);
      remove_cl("miner_glow", [1, 2], ["h"]);
      remove_cl("money", [1, 2, 9], ["n"]);
    }

    if(counter == 160) {
      add_cl("money", [10, 11], ["h"]);
      add_cl("money", [3, 4], ["n"]);
      remove_cl("money", [1, 2, 9], ["h"]);
    }

    if(counter == 190) {
      add_cl("money", [5, 6, 7, 8], ["h"]);
      add_cl("node_glow", [4], ["h"]);
      add_cl("miner_glow", [1, 2], ["h"]);
    }

    if(counter == 200) {
      add_cl("money", [10, 11], ["n"]);
    }

    if(counter == 210) {
      add_cl("money", [5, 6, 7, 8], ["n"]);
    }

    if(counter == 230) {
      add_cl("money", [1, 2, 9], ["h"]);
      if(popup == 6) {
        $("#spopup6").setAttribute("class", "vis");
        // $("#learn_more").classList.add("vis");
        popup++;
      }
    }

    if(counter == 240) {
      if(popup == 5) {
        $("#spopup5").setAttribute("class", "vis");
        popup++;
      }
    }

    if(counter == 250) {
      add_cl("money", [1, 2, 9], ["n"]);
      if(popup == 4) {
        $("#spopup4").setAttribute("class", "vis");
        popup++;
      }
    }

    counter++;
    if(counter < saito_loop) {
      animID = requestAnimationFrame(animate2);
    } else {
      counter = 0;
      animID = requestAnimationFrame(animate2);
    }
  } else {
    if(counter == 0) {
      add_cl("ubeam", [1, 2, 3], ["n"]);
      add_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 10) {
      remove_cl("ubeam", [1, 2, 3], ["n"]);
      remove_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 40) {
      remove_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("dots", [1, 2], ["n"]);
      add_cl("beam", [1, 2], ["n"]);
    }
    if(counter == 60) {
      remove_cl("dots", [1, 2], ["n"]);
      remove_cl("beam", [1, 2], ["n"]);
      add_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("node_glow", [2, 5], ["h"]);
    }
    if(counter == 110) {
      remove_cl("node_glow", [2, 5], ["h"]);
      add_cl("dots", [9], ["n"]);
    }
    if(counter == 120) {
      remove_cl("dots", [9], ["n"]);

      //repeat
      add_cl("ubeam", [1, 2, 3], ["n"]);
      add_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 130) {

      //repeat
      remove_cl("ubeam", [1, 2, 3], ["n"]);
      remove_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 140) {
      add_cl("node_glow", [5], ["h"]);
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 160) {

      //repeat
      remove_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("dots", [1, 2], ["n"]);
      add_cl("beam", [1, 2], ["n"]);
    }
    if(counter == 170) {
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 180) {

      //repeat
      remove_cl("dots", [1, 2], ["n"]);
      remove_cl("beam", [1, 2], ["n"]);
      add_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("node_glow", [2, 5], ["h"]);
    }
    if(counter == 190) {
      add_cl("node_glow", [2], ["h"]);
      add_cl("dots", [5, 11, 16], ["n"]);
    }
    if(counter == 220) {
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("dots", [5, 11, 16], ["n"]);
    }
    if(counter == 230) {

      //repeat
      remove_cl("node_glow", [2, 5], ["h"]);
      add_cl("dots", [9], ["n"]);
    }
    if(counter == 240) {
      add_cl("node_glow", [1, 7], ["h"]);
      add_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);

      //repeat
      remove_cl("dots", [9], ["n"]);
    }
    if(counter == 260) {

      //repeat
      add_cl("node_glow", [5], ["h"]);
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 270) {
      remove_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);

      //repeat_2
      add_cl("ubeam", [1, 2, 3], ["n"]);
      add_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 280) {

      //repeat_2
      remove_cl("ubeam", [1, 2, 3], ["n"]);
      remove_cl("dots", [23, 24, 25], ["n"]);
    }
    if(counter == 290) {
      add_cl("node_glow", [3, 6], ["h"]);

      //repeat
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 310) {

      //repeat
      add_cl("node_glow", [2], ["h"]);
      add_cl("dots", [5, 11, 16], ["n"]);

      //repeat_2
      remove_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("dots", [1, 2], ["n"]);
      add_cl("beam", [1, 2], ["n"]);
    }
    if(counter == 320) {
      remove_cl("node_glow", [4], ["h"]);
      remove_cl("miner_glow", [1, 2], ["h"]);
      remove_cl("money", [1, 2], ["n"]);
    }
    if(counter == 330) {

      if(popup == 3) {
        $("#popup3").setAttribute("class", "vis");
        popup++;
      }

      //repeat_2
      remove_cl("dots", [1, 2], ["n"]);
      remove_cl("beam", [1, 2], ["n"]);
      add_cl("app_glow", [1, 2, 3], ["h"]);
      add_cl("node_glow", [2, 5], ["h"]);
    }
    if(counter == 340) {

      //repeat
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("dots", [5, 11, 16], ["n"]);
    }
    if(counter == 350) {
      remove_cl("money", [1, 2], ["h"]);
      if(popup == 1) {
        $("#popup1").setAttribute("class", "vis");
        popup++;
      }
    }
    if(counter == 360) {

      //repeat
      add_cl("node_glow", [1, 7], ["h"]);
      add_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
    }
    if(counter == 370) {
      add_cl("miner_glow", [1, 2], ["h"]);
      add_cl("node_glow", [4], ["h"]);
    }
    if(counter == 380) {

      //repeat_2
      remove_cl("node_glow", [2, 5], ["h"]);
      add_cl("dots", [9], ["n"]);
    }
    if(counter == 390) {

      //repeat
      remove_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);

      //repeat_2
      remove_cl("dots", [9], ["n"]);
    }
    if(counter == 410) {

      //repeat
      add_cl("node_glow", [3, 6], ["h"]);

      //repeat_2
      add_cl("node_glow", [5], ["h"]);
      add_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 440) {

      //repeat
      remove_cl("node_glow", [4], ["h"]);
      remove_cl("miner_glow", [1, 2], ["h"]);
      remove_cl("money", [1, 2], ["n"]);

      //repeat_2
      remove_cl("dots", [4, 7, 10, 14, 15], ["n"]);
    }
    if(counter == 460) {

      //repeat_2
      add_cl("node_glow", [2], ["h"]);
      add_cl("dots", [5, 11, 16], ["n"]);
    }
    if(counter == 470) {

      //repeat
      remove_cl("money", [1, 2], ["h"]);
    }
    if(counter == 490) {

      //repeat
      add_cl("miner_glow", [1, 2], ["h"]);
      add_cl("node_glow", [4], ["h"]);

      //repeat_2
      remove_cl("node_glow", [1, 3, 6, 7], ["h"]);
      remove_cl("dots", [5, 11, 16], ["n"]);
    }
    if(counter == 510) {

      //repeat_2
      add_cl("node_glow", [1, 7], ["h"]);
      add_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
    }
    if(counter == 540) {
      remove_cl("dots", [3, 6, 12, 13, 17, 18], ["n"]);
    }
    if(counter == 560) {
      add_cl("node_glow", [3, 6], ["h"]);
    }

    if(counter == 590) {

      //repeat_2
      remove_cl("node_glow", [4], ["h"]);
      remove_cl("miner_glow", [1, 2], ["h"]);
    }

    if(counter == 620) {
      add_cl("money", [1, 2], ["h"]);
      add_cl("node_glow", [4], ["h"]);
      add_cl("miner_glow", [1, 2], ["h"]);
      if(popup == 2) {
        $("#popup2").setAttribute("class", "vis");
        popup++;
      }
      if(popup == 4) {
        $("#popup4").setAttribute("class", "vis");
        popup++;
      }
    }

    counter++;
    if(counter <= total_loop) {
      animID = requestAnimationFrame(animate2);
    } else {
      counter = 0;
      animID = requestAnimationFrame(animate2);
    }
  }
}

switch_mode();
animate();
